-- id               ...
-- nome             Nome da Cidade
-- codigo_ibge      Código do IBGE referente a cidade
-- populacao_2010   População em 2010, segundo IBGE
-- densidade_demo   População por KM quadrado
-- area             Área do município ex: "3916.507" - 3.916,507 KM Quadrado - Ano de 2015

CREATE TABLE cidades (
    id integer NOT NULL AUTO_INCREMENT,
    nome varchar(250),
    codigo_ibge integer,
    estado_id integer,
    populacao_2010 integer,
    densidade_demo numeric(10, 2),
    gentilico varchar(250),
    area numeric(10, 3),
    PRIMARY KEY (`id`)
);

CREATE TABLE estados (
    id integer NOT NULL AUTO_INCREMENT,
    nome varchar(250),
    sigla varchar(250),
    PRIMARY KEY (`id`)
);

ALTER TABLE cidades
    ADD CONSTRAINT fk_estado_id FOREIGN KEY (estado_id) REFERENCES estados(id) ON DELETE CASCADE;


